import Carousel from "./Components/Carousel";
import { Home } from "./Components/Home";
import AboutUs from "./Pages/AboutUs";
import Service from "./Pages/Services";
import Contact from "./Pages/Contact";
import Header from "./Components/Header";
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom'
function App() {
  return (
    <div>

      <Router>
      <Header/>
          <Routes>
            <Route className={({ isActive, isPending }) =>
                      isActive
                        ? "active"
                        : isPending
                        ? "pending"
                        : ""} exact path="/" element={<Home />} />
            <Route className="menu-active" exact path="/about-us" element={<AboutUs/>} />
            <Route className="menu-active" exact path="/Services" element={<Service/>} />
            <Route className="menu-active" exact path="/contact-us" element={<Contact/>} />
            <Route path="*" element={<Home/>} />
          </Routes>
      </Router>
    </div>
  );
}

export default App;
